import React from 'react';
import Header from './components/Header';
import InputSection from './components/InputSection';
import DrawButton from './components/DrawButton';

function App() {
    return (
        <div className="bg-mystic-900 text-crystal-500 min-h-screen flex flex-col">
            <Header />
            <div className="flex-1 p-4">
                <h1 className="text-4xl font-bold text-center mb-6">Welcome to Tarot AI</h1>
                <InputSection />
                <DrawButton />
            </div>
        </div>
    );
}

export default App;
